import React, { Component } from 'react';

class Home extends Component 
{

    constructor(props) {
        super(props)
    }

    render()
    {
        return (<div>
            <Navbar />
            <Header />
            <div className="container">
              <p>Contenu de la page</p>
            </div>
            <Footer />
          </div>)
    }

}

export default Home;
